def test_file_uploaded():
    results = {'oem_production_plans/OEM Supplier Production capacity 1.3.22.xlsx': 'oem_production_plans',
               'kes_franke/Crisis_KES_FRANKE_EMEA_20220107.txt': 'kes_franke',
               'kes_HK/MCDEquipmentCrisisAvailability-@20220104.xlsx': 'kes_HK',
               'mcd_market_plans/India_Delhi India CPRL  Updated Equipment Market Forecast Template 10.15.21 v6r.xlsx': 'mcd_market_plans',
               'lookup tables/KES Product Lookup Table V8.csv': 'lookup tables',
               'business_rules/Assured_Supply_Business_Rules_1.07.2022.xlsx': 'business_rules',
               'asdn/helloasdsa.csv': 'not found',
               'otherpath/nextlevel/oem_production_plans/OEM Supplier Production capacity 1.3.22.xlsx': 'oem_production_plans'
               }
    t = 'otherpath/nextlevel/oem_production_plans/OEM Supplier Production capacity 1.3.22.xlsx'.split(os.path.sep)
    s = t[-2]
    for key, value in results.items():
        if key == 'asdn/helloasdsa.csv':
            assert value == kl.file_uploaded(results.values(), key)
        else:
            assert key.split(os.path.sep)[-2] == kl.file_uploaded(results.values(), key.split(os.path.sep)[-2])


def handle_special_chars(key):
    results = {'lookup tables/KES_Product%40Lookup_Table_V8.csv': 'lookup tables/KES_Product@Lookup_Table_V8.csv',
               'lookup tables/KES_Product+Lookup+Table_V8.csv': 'lookup tables/KES_Product Lookup Table_V8.csv',
               'lookup tables/KES_Product%28Lookup_Table_V8.csv': 'lookup tables/KES_Product(Lookup_Table_V8.csv',
               'lookup tables/KES_Product%29Lookup_Table_V8.csv': 'lookup tables/KES_Product)Lookup_Table_V8.csv',
               'lookup tables/KES_Product%22Lookup_Table_V8.csv': 'lookup tables/KES_Product&Lookup_Table_V8.csv'
               }
    for key, value in results.items():
        assert value == kl.handle_special_chars(key)


